import React from 'react';
import { useNavigate } from 'react-router-dom';
import './FeedbackForm.css';

const ServiceSelection = ({ setServiceType }) => {
  const navigate = useNavigate();

  const handleServiceClick = (serviceType) => {
    setServiceType(serviceType); // Update the selected service
    navigate('/emoji'); // Navigate to the next page
  };

  return (
    <div className="feedback-form-container">
      <h1>WELCOME TO NPPF SERVICE FEEDBACK SYSTEM</h1>
      <p>Select a service</p>
      <div className="service-icons">
        <div
          className="icon"
          onClick={() => handleServiceClick('pension')}
        >
          <img src="/icons/pension.png" alt="Pension" />
          <span>Pension</span>
        </div>
        <div
          className="icon"
          onClick={() => handleServiceClick('loan')}
        >
          <img src="/icons/loan.png" alt="Loan" />
          <span>Loan</span>
        </div>
        <div
          className="icon"
          onClick={() => handleServiceClick('pensioners')}
        >
          <img src="/icons/pensioners.png" alt="Pensioners" />
          <span>Pensioners</span>
        </div>
        <div
          className="icon"
          onClick={() => handleServiceClick('investment')}
        >
          <img src="/icons/investment.png" alt="Investment" />
          <span>Investment</span>
        </div>
      </div>
      <div className="footer">
        <p>
          Get In Touch <br />
          1039 (Toll-Free) | WhatsApp (17170884) <br />
          lungten.norbu@nppf.org.bt
        </p>
        <div className="locations">
          <div>Thimphu</div>
          <div>Phuentsholing</div>
        </div>
      </div>
    </div>
  );
};

export default ServiceSelection;
